import React from 'react';
import emailjs from 'emailjs-com';


export default function Form() {

    function sendEmail(e) {
        e.preventDefault();
        function myFunction() {
            document.getElementById("demo-form").reset();
        }

        emailjs.sendForm('service_olw30ew', 'template_2qz531s', e.target, 'user_1I17qEirtZkLAh5ed5qOv')
        .then(
            function (response) {
                //console.log("SUCCESS. status=%d, text=%s", response.status, response.text);
                alert("Email sent successfully!");
                myFunction();
            },
            function (error) {
                //console.log("FAILED", error);
                alert("FAILED!" + error);
            }
        );
    }


    return (
        <form className="contact-form" onSubmit={sendEmail} action="/" id="demo-form">
            <div className="form-group">
                <label>Number</label>
                <input className="form-control" type="number" name="contact_number" />
            </div>
            <div className="form-group">
                <label>Name</label>
                <input className="form-control" type="text" name="user_name" />
            </div>
            <div className="form-group">
                <label>Email</label>
                <input className="form-control" type="email" name="user_email" />
            </div>
            <div className="form-group">
                    <label>Message</label>
                <textarea name="message" />

            </div>
            <button type="submit" className="btn btn-primary">Submit</button>
        </form>
    );
}
